}

{
  "overview": "خوزستان، جو ایران کے جنوب مغربی حصے میں واقع ہے، اپنے تاریخی ورثہ اور ثقافتی تنوع کے لیے مشہور ہے۔ یہ علاقہ قدیم دور سے ہی مختلف تہذیبوں کا گہوارہ رہا ہے، جہاں ایلامی، آشوری، اور فارسی تہذیبوں کے اثار پائے جاتے ہیں۔ خوزستان کی زمین بڑی زرخیز ہے، جو کہ دریائے کارون اور دوسری ندیوں کی بدولت ہے۔ اس خطے کی تاریخ اور تہذیبی آثار اس کی قدیم ماضی کی کہانی کہتے ہیں۔"
