{
  "overview": "L'Inde, connue historiquement sous le nom d'al-Hind, a toujours été une terre de diversité culturelle profonde et de pluralisme intellectuel. Ses contributions au monde en matière de religion, de philosophie, et d'arts sont notables. Des textes anciens tels que le Rigveda et le Mahabharata jusqu'aux traités de mathématiques et d'astronomie, l'Inde a enrichi le patrimoine mondial de savoirs. Le système de numération décimal ainsi que des concepts tels que le zéro ont leurs racines en Inde, influençant significativement les sciences et la technologie mondiales."
}

