{
  "overview": "Transoxiana, en árabe ما وراء النهر, se refiere a la región histórica situada en Asia Central, que comprende principalmente la moderna Uzbekistán y partes de Tayikistán, Kazajistán y Kirguistán. Fue un prominente centro de comercio e intercambio cultural debido a su ubicación estratégica en la Ruta de la Seda. La región juega un papel crucial en la historia del Islam debido a su rica tradición en las ciencias, arte y religión. Además, Transoxiana es conocida por sus contribuciones significativas al desarrollo de la literatura y filosofía islámica."
