{
  "overview": "Kirman, kini dikenali sebagai Wilayah Kerman di Iran, adalah sebuah kawasan yang kaya dengan sejarah dan budaya. Sejarahnya yang panjang mencakup banyak peristiwa penting dalam konteks Islam dan peradaban Persia. Wilayah ini terkenal dengan penghasilan karpet yang indah yang mendunia, serta arsitektur yang mengesankan dan peninggalan sejarah yang masih terawat baik. Kirman juga dikenal dengan peranannya dalam perdagangan kuno sebagai bagian dari Jalur Sutera, mempengaruhi pertukaran budaya dan ekonomi antar peradaban besar dari Timur ke Barat."
