{
  "overview": "Khazar, tarihsel olarak Doğu Avrupa ve Kafkaslar'da yer alan bir bölgeydi. Orta Çağ döneminde, özellikle 7. ve 10. yüzyıllar arasında, geniş bir coğrafyaya hâkim olan Khazarlar, ticaret yolları üzerindeki stratejik konumu sayesinde önemli bir ekonomik ve kültürel merkez haline gelmişti. Bu dönemde, çok sayıda etnik grup ve dinî inancın kesişme noktası oldu. Khazar Devleti, özellikle Yahudiliği resmi din olarak benimsemesi ile bilinir. Arkeolojik bulgular, Khazarların yaşam tarzı ve sosyal yapısı hakkında bilgiler sunmaktadır."
}

{
  "overview": "Le Khazar, situé entre l'Europe orientale et le Caucase, était un royaume influent. Principalement connu pour sa position stratégique le long des voies commerciales importantes, ce royaume a facilité les interactions entre l'Europe, l'Asie et le Moyen-Orient. Les Khazars, peuple turcique, adoptèrent le judaïsme comme religion d'État au 8ème siècle, ce qui constitua un développement notable dans la région. Ils jouèrent un rôle majeur dans les affaires politiques et économiques de l'époque, avant de décliner au 10ème siècle face aux forces émergentes des Rus' de Kiev."
}

