{
  "overview": "برقة، المعروفة حالياً بمنطقة الجبل الأخضر في ليبيا، تتمتع بتاريخ غني يعود للعصور القديمة. كانت مركزًا للثقافة والعلم في العصر الهلنستي، وشهدت ظهور العديد من الفلاسفة والعلماء. خلال الفترة الإسلامية، أصبحت برقة جزءًا من الدولة الإسلامية ولعبت دورًا مهمًا في نشر الإسلام بفضل موقعها الاستراتيجي. على مر العصور، استقبلت برقة العديد من العلماء والمفكرين الذين أثروا في تاريخها الثقافي والديني."
}

{
  "overview": "Khurasan, terletak di timur laut Iran, sebahagian Afghanistan, dan Turkmenistan, merupakan kawasan yang kaya dengan sejarah dan budaya Islam. Serupa dengan Oasis penuh dengan keilmuan dan peradaban besar Islam, Khurasan telah melahirkan banyak ulama, ahli sufi, dan pejuang. Kawasan ini juga terkenal dengan produksi kertas dan perkembangan teknologi cetak dalam dunia Islam. Khurasan tidak hanya mengukir sejarah melalui peristiwa-peristiwanya tetapi juga dengan peranannya sebagai pusat penyebaran ilmu pengetahuan dan budaya di kawasan Asia Tengah." 
}

{
  "overview": "Kirman, conocido actualmente como la provincia de Kerman en Irán, es famoso por su profunda herencia cultural e histórica en el contexto islámico. Este región ha sido un centro importante para el desarrollo de la literatura, la ciencia y el arte. Durante la era medieval, Kirman fue un prominente centro de aprendizaje y un refugio para eruditos y poetas. La arquitectura de Kirman, con sus impresionantes mezquitas y bazares, refleja la rica historia islámica que aún pervive en sus tradiciones y prácticas culturales."
