{
  "overview": "Proveniente de la región históricamente conocida como Rum, situada en lo que hoy es Anatolia, Turquía. Este área jugó un papel prominente como centro de poder durante el Imperio Bizantino, antes de ser parte del fulcro político y cultural del Imperio Otomano. Rum fue escenario de significativas interacciones entre culturas cristianas y musulmanas, algo evidente en su rica herencia arquitectónica, como la icónica Hagia Sophia, que fungió como iglesia y luego mezquita. La influencia de estas interacciones se refleja en las tradiciones artísticas y literarias que caracterizan a la región."
}

